import React, { Component } from "react";
import { Link } from "react-router-dom";


function Saved() {
        return (
            <div className="jumbotron jumbotron-fluid">
                <div className="container">
                    <h1 className="display-4">Saved Books</h1>
                </div>
                <Link to = "/">
                Search Books
                </Link>
            </div>
        );
    }

export default Saved;
